import React from 'react';
import axios from 'axios';


class Home extends React.Component{

    componentDidMoun(){
        const albums = axios.get('https://jsonplaceholder.typicode.com/albums');
        console.log(albums);
    }


    render(){
        return (
            <div>
                <div>
                {albums.title}
                </div>
            </div>

        );    
    }
}

export default Home;
